                            const chunks = Array.from({
                                    length: Math.ceil(array.length / chunkSize)
                                },
                                (_, i) => {
                                    const start = chunkSize * i;
                                    return array.slice(start, start + chunkSize);
                                }
                            );
                            return chunks;
